"  <div id=\"topicText\">",
"   <p class=\"headingAnchor\" id=\"H15357686\">",
"    <span class=\"h1\">",
"     INTRODUCTION",
"    </span>",
"    &nbsp;&mdash;&nbsp;The following material represents a subset of chemotherapy regimens that are used for the treatment of women with gynecologic cancers.",
"    <strong>",
"     This is",
"    </strong>",
"    <strong>",
"     not an exhaustive list",
"    </strong>",
"    ; it includes regimens that are considered by the authors and editors to be commonly used and important for the care of patients with gynecologic cancers. Additional regimens may be added over time, particularly as treatment for gynecologic cancers evolve.",
"   </p>",
"   <p>",
"    This topic review is intended to provide only a listing of chemotherapy regimens. It does not address the appropriate context for use of these regimens in the care of patients with gynecologic cancer. Clinicians should refer to the individual disease-oriented topic reviews that discuss the use of these protocols in appropriate clinical situations:",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H15357842\">",
"    <span class=\"h2\">",
"     Ovarian cancer",
"    </span>",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?21/11/21689?source=see_link\">",
"       \"First-line chemotherapy for advanced (stage III or IV) epithelial ovarian, fallopian tubal, and peritoneal cancer\"",
"      </a>",
"      .)",
"     </li>",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?25/39/26231?source=see_link\">",
"       \"Adjuvant therapy of early stage (stage I and II) epithelial ovarian, fallopian tubal, or peritoneal cancer\"",
"      </a>",
"      .)",
"     </li>",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?36/21/37209?source=see_link\">",
"       \"Medical treatment for relapsed epithelial ovarian, fallopian tubal, or peritoneal cancer: Platinum-sensitive disease\"",
"      </a>",
"      .)",
"     </li>",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?29/17/29977?source=see_link\">",
"       \"Medical treatment for relapsed epithelial ovarian, fallopian tubal, or peritoneal cancer: Platinum-resistant disease\"",
"      </a>",
"      .)",
"     </li>",
"    </ul>",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H15358532\">",
"    <span class=\"h2\">",
"     Endometrial cancer",
"    </span>",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?8/41/8855?source=see_link\">",
"       \"Approach to adjuvant treatment of endometrial cancer\"",
"      </a>",
"      .)",
"     </li>",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?41/0/41991?source=see_link\">",
"       \"Adjuvant treatment of high-risk endometrial cancers\"",
"      </a>",
"      .)",
"     </li>",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?22/18/22825?source=see_link\">",
"       \"Treatment of locally advanced, recurrent, or metastatic endometrial cancer\"",
"      </a>",
"      .)",
"     </li>",
"    </ul>",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H15359201\">",
"    <span class=\"h2\">",
"     Cervical cancer",
"    </span>",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?7/50/7976?source=see_link\">",
"       \"Management of locally advanced cervical cancer\"",
"      </a>",
"      .)",
"     </li>",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?32/37/33368?source=see_link\">",
"       \"Management of recurrent or metastatic cervical cancer\"",
"      </a>",
"      .)",
"     </li>",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?5/23/5498?source=see_link&amp;anchor=H1336437742#H1336437742\">",
"       \"Small cell neuroendocrine carcinoma of the cervix\", section on 'Treatment'",
"      </a>",
"      .)",
"     </li>",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?6/49/6938?source=see_link\">",
"       \"Invasive cervical adenocarcinoma\"",
"      </a>",
"      .)",
"     </li>",
"    </ul>",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H15359490\">",
"    <span class=\"h2\">",
"     Uterine sarcoma",
"    </span>",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?43/34/44585?source=see_link\">",
"       \"Clinical features, diagnosis, staging, and treatment of uterine carcinosarcoma\"",
"      </a>",
"      .)",
"     </li>",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?14/57/15257?source=see_link\">",
"       \"Treatment and prognosis of uterine leiomyosarcoma\"",
"      </a>",
"      .)",
"     </li>",
"    </ul>",
"   </p>",
"   <p>",
"    In addition, protocols for the treatment of women with sex cord stromal and germ cell tumors are covered separately.",
"   </p>",
"   <p>",
"    <ul class=\"bullet-block\">",
"     <li>",
"      (See",
"      <a class=\"medical medical_review\" href=\"mobipreview.htm?19/25/19858?source=see_link\">",
"       \"Treatment protocols for germ cell tumors\"",
"      </a>",
"      .)",
"     </li>",
"    </ul>",
"   </p>",
"   <p>",
"    These tables are provided as examples of how to administer these regimens; there may be other acceptable methods. All chemotherapy regimens must be administered by clinicians who are trained in the use of chemotherapy. The clinician is expected to use his or her independent medical judgment in the context of individual circumstances to make adjustments, as necessary.",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H15359315\">",
"    <span class=\"h1\">",
"     REGIMENS",
"    </span>",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H15359323\">",
"    <span class=\"h2\">",
"     Regimens for ovarian cancer",
"    </span>",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H15359348\">",
"    <span class=\"h3\">",
"     Cisplatin plus paclitaxel",
"    </span>",
"    &nbsp;&mdash;&nbsp;(",
"    <a class=\"graphic graphic_table graphicRef50698 \" href=\"mobipreview.htm?14/16/14606\">",
"     table 1",
"    </a>",
"    )",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H15359396\">",
"    <span class=\"h3\">",
"     Carboplatin plus paclitaxel",
"    </span>",
"    &nbsp;&mdash;&nbsp;(",
"    <a class=\"graphic graphic_table graphicRef65626 \" href=\"mobipreview.htm?6/57/7070\">",
"     table 2",
"    </a>",
"    )",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H1067422739\">",
"    <span class=\"h3\">",
"     Carboplatin plus pegylated liposomal doxorubicin",
"    </span>",
"    &nbsp;&mdash;&nbsp;(",
"    <a class=\"graphic graphic_table graphicRef86168 \" href=\"mobipreview.htm?7/5/7262\">",
"     table 3",
"    </a>",
"    )",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H15359437\">",
"    <span class=\"h3\">",
