"    </span>",
"    &nbsp;&mdash;&nbsp;(",
"    <a class=\"graphic graphic_table graphicRef61475 \" href=\"mobipreview.htm?29/19/30014\">",
"     table 4",
"    </a>",
"    )",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H1650215328\">",
"    <span class=\"h3\">",
"     Weekly paclitaxel with every three week carboplatin",
"    </span>",
"    &nbsp;&mdash;&nbsp;(",
"    <a class=\"graphic graphic_table graphicRef87790 \" href=\"mobipreview.htm?10/25/10654\">",
"     table 5",
"    </a>",
"    )",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H1734336749\">",
"    <span class=\"h3\">",
"     Carboplatin and gemcitabine plus bevacizumab",
"    </span>",
"    &nbsp;&mdash;&nbsp;(",
"    <a class=\"graphic graphic_table graphicRef87827 \" href=\"mobipreview.htm?29/10/29870\">",
"     table 6",
"    </a>",
"    )",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H15359558\">",
"    <span class=\"h2\">",
"     Regimens for endometrial cancer",
"    </span>",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H15359597\">",
"    <span class=\"h3\">",
"     Carboplatin plus paclitaxel",
"    </span>",
"    &nbsp;&mdash;&nbsp;(",
"    <a class=\"graphic graphic_table graphicRef65626 \" href=\"mobipreview.htm?6/57/7070\">",
"     table 2",
"    </a>",
"    )",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H15359621\">",
"    <span class=\"h2\">",
"     Regimens for cervical cancer",
"    </span>",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H934171843\">",
"    <span class=\"h3\">",
"     EP (etoposide plus cisplatin)",
"    </span>",
"    &nbsp;&mdash;&nbsp;(",
"    <a class=\"graphic graphic_table graphicRef63222 \" href=\"mobipreview.htm?38/62/39917\">",
"     table 7",
"    </a>",
"    )",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H15359662\">",
"    <span class=\"h3\">",
"     Cisplatin plus paclitaxel",
"    </span>",
"    &nbsp;&mdash;&nbsp;(",
"    <a class=\"graphic graphic_table graphicRef50698 \" href=\"mobipreview.htm?14/16/14606\">",
"     table 1",
"    </a>",
"    )",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H15359703\">",
